'use strict';
let list = require('@gehtsoft/LuaxStdlib-node').list;
//@@DocBrief("The class provides access to a collection of closed position identification information items")
class ClosedPositionInfoList extends list {
    get(index) {
        return super.get(index);
    }
    set(index, value) {
        super.set(index, value);
    }
    add(value) {
        super.add(value);
    }
    removePositionInfo(value) {
        let i, found;
        found = false;
        for (i = 0; i <= super.length() - 1; i += 1) {
            if (super.get(i).getId() == value.getId()) {
                found = true;
                break;
            }
        }
        if (found) {
            super.remove(i);
        }
    }
    toArray() {
        let i, result;
        result = new Array(super.length());
        for (i = 0; i <= super.length() - 1; i += 1) {
            result[i] = super.get(i);
        }
        return result;
    }
}
module.exports = ClosedPositionInfoList
